#### 1、The onnx model created by the sklearn-onnx as shown below:
```
import numpy as np
from sklearn.linear_model import LogisticRegression

np.random.seed(12)
num_observations = 5000 
x1 = np.random.multivariate_normal([0, 0], [[1, .75],[.75, 1]], num_observations) 
x2 = np.random.multivariate_normal([1, 4], [[1, .75],[.75, 1]], num_observations) 

X = np.vstack((x1, x2)).astype(np.float32) 
y = np.hstack((np.zeros(num_observations), 
               np.ones(num_observations))) 
print (X.shape, y.shape) 

lf = LogisticRegression(fit_intercept=True, C = 1e15)
lf.fit(X, y)
print ("(sklearn)逻辑回归的参数w, b分别为: ", lf.coef_, lf.intercept_) 
print(lf.predict([ X[4998],X[5001], X[5003], X[4997] ]))

from skl2onnx import convert_sklearn
from skl2onnx.common.data_types import FloatTensorType

onx = convert_sklearn(lf, initial_types=[('float_input', FloatTensorType([None, 2]))]
)
with open("./models/lg_model.onnx", "wb") as f:
    f.write(onx.SerializeToString())
```

